import React from 'react'
import background from './images/grad.png'

const Invite = () => {
    return (
        <div style={{ backgroundImage: `url(${background})` }}>
            <div class="m-auto w-50 p-3 text-center pt-5">
                <h1>Eden and Elijah's</h1>
                <h2>Graduation Party</h2>
            </div>
        </div>
    )
}

export default Invite
